import { Outlet, Link } from "react-router-dom";

function Navbar_warna() {
  return (
    <>
    <div>

  <nav className="main-header navbar navbar-expand-md navbar-light navbar-white" style="background: linear-gradient(to right, #f00, #00f); ">
    <div className="container">
      <a href="assets/index3.html" className="navbar-brand">
        <img src="assets/dist/img/AdminLTELogo.png" alt="AdminLTE Logo" className="brand-image img-circle elevation-3" style="opacity: .8"/>
        <span className="brand-text font-weight-light" style="color: white;">Silat E-Skor</span>
      </a>

      <button className="navbar-toggler order-1" type="button" data-toggle="collapse" data-target="#navbarCollapse" aria-controls="navbarCollapse" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>


    </div>
  </nav>

    </div>
    <Outlet />
    </>
  );
}

export default Navbar_warna;
